package main

import (
	"github.com/gotk3/gotk3/gtk"
	"github.com/multiverse-os/framekit/webkit2"

	"log"
)

func main() {
	// Initialize GTK without parsing any command line arguments.
	gtk.Init(nil)

	win, err := gtk.WindowNew(gtk.WINDOW_TOPLEVEL)
	if err != nil {
		log.Fatal("Unable to create window:", err)
	}
	win.SetTitle("Simple Webkit2 Example")
	win.Connect("destroy", func() {
		gtk.MainQuit()
	})

	//wv, err := webkit.WebViewNewWithUserContentManager(ucm)
	settings, _ := webkit.NewSettings()
	wv, err := webkit.WebViewNewWithSettings(settings)
	if err != nil {
		log.Fatal("Unable to create webview:", err)
	}

	wv.LoadHTML("<html><head><body><center><img src='"+MultiverseLogo+"'><h1 style='color:#ddd;'>Multiverse OS's Framekit UI Library</h1><p style='width:80%;color:#ccc;'>Welcome to the Multiverse OS webkit based graphics UI with javascript, java and other interactive scripting disabled for increased security. This library will provide the basic user interfaces for a variety of Multiverse OS applications. Disabling javascript and java is a temporary measure to allow us to work on GUI applications before writing either (1) a HTML+CSS only browser engine, or (2) a modified version of Webkit with the javascript, and java code removed entirely.</p><script>alert(1)</script></center></body></html>", "http://localhost")

	win.Add(wv)
	win.SetDefaultSize(1000, 800)
	win.ShowAll()

	gtk.Main()
}

var MultiverseLogo = `data:image/png;base64,`
